  \"GHRSST Level 3C Atlantic Subskin Sea Surface Temperature from the Spinning Enhanced
  Visible and Infrared Imager (SEVIRI) on  MSG-3 weather satellite (GDS version 2)\",\n\t\"tracking_summary\":
  {\n\t\t\"total\": 3,\n\t\t\"recent\": 1\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2016-02-26T22:16:07.396615\",\n\t\"name\": \"ghrsst-level-3c-atlantic-subskin-sea-surface-temperature-from-the-spinning-enhanced-visibl\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"A Group for High Resolution Sea Surface
  Temperature (GHRSST) dataset for the Eastern Atlantic Region from the Spinning Enhanced
  Visible and InfraRed Imager (SEVIRI) on the Meteosat Second Generation (MSG-3) satellites
  (launched 5 July 2012). This particular dataset is produced by the European Organization
  for the Exploitation of Meteorological Satellites (EUMETSAT), Ocean and Sea Ice
  Satellite Application Facility (OSI SAF) in France. The Meteosat Second Generation
  (MSG-3) satellites are spin stabilized geostationary satellites operated by the
  European Organization for the Exploitation of Meteorological Satellites (EUMETSAT)
  to provide accurate weather monitoring data through its primary instrument SEVIRI,
  which has the capacity to observe the Earth in 12 spectral channels. Eight of these
  channels are in the thermal infrared, providing among other information, observations
  of the temperatures of clouds, land and sea surfaces at approximately 5 km resolution
  with a 15 minute duty cycle. The OSI-SAF SST processing chain for geostationary
  satellite will ingest the SEVIRI radiometric data in full time (every 15 minutes)
  and space resolution, then the NWC (nowcasting) SAF cloud mask is applied. There
  are no additions to the original mask as contrary to the METOP/AVHRR chain. The
  operational products are then produced by remapping over a 0.05 degree regular grid
  SST fields obtained by aggregating all 15 minute SST data available in one hour
  time, and the priority being given to the value the closest in time to the product
  nominal hour. This dataset produced adheres to the GHRSST Data Processing Specification
  (GDS) version 2 format specifications.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
